import React from 'react';
import ReactDOM from 'react-dom';

const TodoStatusFilter = () => {
    return (
        <div>
            <input type="button" value={'all'}/>
            <input type="button" value={'active'}/>
            <input type="button" value={'done'}/>


        </div>
    )
}



const TodoSearch = () => {
    return (
        <div>
            <input type="text"/>
        </div>
    )
}

const TodoList = () => {
    return (
        <div>
            <ul>
                <li><TodolistItem li='Drink Coffee' /></li>
                <li><TodolistItem li='Learn React' /></li>
                <li><TodolistItem li='Drink vodka' /></li>
            </ul>
        </div>
    )
}

const TodolistItem = ({li}) => {
    return (
        <span>{li}</span>
    )
}

const TodoHeader = () => {
    return (
        <div>
            <TodoSearch />
            <TodoStatusFilter />
            <TodoList />
        </div>
    )
};

const App  = () => {
    const Todos = [
        {id: 1,label: 'Drink Coffee',done: false,important: false},
        {id: 2,label: 'Lear React',done: false,important: false},
        {id: 3,label: 'Drink vodka',done: false,important: false},
        {id: 4,label: 'Drink cola',done: false,important: false},

    ]
    return (
        <div className={'wrapper'}>
            <TodoHeader />
            <TodoList />
        </div>
    )
}
ReactDOM.render(<App />,document.getElementById('root'));
